import React, { Component } from "react";
import Nav from "./components/Nav";

class App extends Component {

  render() {
    return (
      <Container fluid>
        <Row>
          <Col size="md-6">
            <h1>"Hello World</h1>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Search;
